webpackJsonp([88,428],{2:function(e,t){e.exports="data:image/png;base64,"},257:function(e,t){e.exports="data:image/png;base64,"},1644:function(e,t,l){e.exports={frontmatter:l(651),content:l(2829)}},2829:function(e,t,l){e.exports="<section class=tips id=laeringsmal> <h1 class=tips id=laeringsmal>Læringsmål</h1> <ul> <li>beskrive og gjennomføre spegling, rotasjon og parallellforskyving</li> <li>beskrive plassering og flytting i rutenett, på kart og i koordinatsystem, med og utan digitale hjelpemiddel, og bruke koordinatar til å berekne avstandar parallelt med aksane i eit koordinatsystem</li> </ul> </section> <section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I denne oppgaven skal vi importere en geometrisk figur og deretter <code class=blockmotion>rotere</code> den.</p> <figure><img src="+l(257)+' alt=""></figure> </section> <section class=activity id=steg-1-vi-roterer-en-likebeint-trekant> <h1 class=activity id=steg-1-vi-roterer-en-likebeint-trekant>Steg 1: Vi roterer en likebeint trekant</h1> <p><em>For å gjøre det enkelt å komme i gang, henter vi inn en ferdig figur fra biblioteket til Scratch. Denne figuren er tilnærmet lik en likebeint trekant</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Start et nytt prosjekt.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Slett kattefiguren ved å høyreklikke på den og velge <code>slett</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Legg til en ny figur. Klikk på <img src='+l(2)+' alt="Velg figur fra biblioteket">-knappen og velg trollmannshatten. Vi har brukt <code>Ting/Wizard Hat</code>-figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Gi den nye figuren navnet <code>Hattulf</code> ved å klikke på <code>i</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Før vi begynner med selve oppgaven, skal vi legge inn en liten hjelpefunksjon om noe uventet skulle skje:</label></p> <pre class=blocks>når [n v] trykkes\nvis\npek i retning [90 v]\ngå til x: (0) y: (0)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Skulle noe uventet skje nå, trenger du bare å trykke på tasten N på tastaturet, så vil Hattulf gå tilbake til utgangspunktet, slik at du kan prøve på nytt.</label></p> </li> </ul> <p>Vi skal nå gi Scratch beskjed om å <code class=blockmotion>rotere</code> hatten 90 grader.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Legg til følgende skript på <code>Hattulf</code>-figuren din.</label></p> <pre class=blocks>når grønt flagg klikkes\nvend høyre (90) grader\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_7><label for=cbx_7> Hva skjer når du trykker på det grønne flagget?</label></li> <li class=task-list-item><input type=checkbox id=cbx_8><label for=cbx_8> Roterer hatten som forventet?</label></li> <li class=task-list-item><input type=checkbox id=cbx_9><label for=cbx_9> Hva tror du skjer om du trykker på det grønne flagget en gang til? I hvilken retning vil toppen av hatten peke?</label></li> <li class=task-list-item><input type=checkbox id=cbx_10><label for=cbx_10> Hvor mange ganger må du be hatten om å rotere før den er tilbake til utgangspunktet?</label></li> </ul> </section> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <p>Rotasjon er jo gøy! Men at ting roterer med 90 grader av gangen er jo litt kjedelig, og litt unaturlig.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Halver antall grader hatten skal rotere per gang:</label></p> <pre class=blocks>når grønt flagg klikkes\nvend høyre (45) grader\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_12><label for=cbx_12> Hvor mange ganger må du trykke på hatten for at den skal rotere hele veien rundt nå?</label></li> <li class=task-list-item><input type=checkbox id=cbx_13><label for=cbx_13> Fortsett å halvere antall grader hatten skal rotere. Prøv å finne en sammenheng mellom hvor mange grader den roteres, og hvor mange ganger du må trykke på det grønne flagget for at den skal roteres helt rundt.</label></li> </ul> <p>Du oppdager kanskje at det begynner å bli veldig mange klikk etterhvert?</p> </section> </section> <section class=activity id=steg-2-a-little-more-action-please> <h1 class=activity id=steg-2-a-little-more-action-please>Steg 2: A little more action, please!</h1> <p>Heldigvis kan vi ved hjelp av litt programmeringsmagi få datamaskinen til å gjøre jobben for oss!</p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Vi legger til en <code class=blockcontrol>styring</code>-kloss som ber hatten om å rotere et bestemt antall ganger:</label></p> <pre class=blocks>når grønt flagg klikkes\ngjenta (8) ganger\nvend høyre (45) grader\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Tips: For hver gang du halverer vinkelen, må du doble antall repetisjoner for at hatten skal snurre like langt.</label></p> </li> </ul> </section> </section> <section class=activity id=steg-3-the-final-countdown> <h1 class=activity id=steg-3-the-final-countdown>Steg 3: The final countdown</h1> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Du vet kanskje at vi vanligvis omtaler en sirkel som 360 grader. Hvis du fortsetter å halvere antall grader forbi 1,40625, vil du oppdage at gradene blir mindre enn 1, og vi må gjenta roteringen 512 ganger. Selv om dette selvfølgelig er mulig, og absolutt nødvendig i enkelte sammenhenger, er det ikke nøvendig for oss nå. Vi tar derfor en snarvei her, og røper at Hattulf skal rotere 1 grad 360 ganger.</label></p> <pre class=blocks>når grønt flagg klikkes\ngjenta (360) ganger\nvend høyre (1) grader\n</pre> </li> </ul> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <p><strong>Klikk på det grønnet flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_17><label for=cbx_17> Roterer hatten hele veien rundt seg selv når du trykker på grønt flagg?</label></li> <li class=task-list-item><input type=checkbox id=cbx_18><label for=cbx_18> Ved å sette antall grader du roterer pr gang til 1, hvor mange ganger må du rotere <code>Hattulf</code> for at han skal gjøre to fulle roteringer? Hva med tre og en halv rotasjon? Ser disse tallene kjent ut?</label></li> </ul> </section> <section id=avslutning> <h2 id=avslutning>Avslutning</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_19><label for=cbx_19> Lagre prosjektet ved å gi det et navn, for eksempel &quot;Geometri 1&quot;</label></li> </ul> </section> </section> '}});